<?php
namespace App\Models;
use CodeIgniter\Model;

class NewsModel extends Model
{
    protected $table = 'news';
    protected $primaryKey = 'seq'; // 기본 키를 seq로 설정
    protected $allowedFields = ['TITLE','SLUG','CONTENT','USE_YN']; // 데이터 삽입할 필드 정의(필드명 대소문자 구분됨)

    public function getNews($seq = false)
    {
        if ($seq === false) {
            return $this->where('USE_YN', 'Y')->findAll();
        }

        return $this->where(['seq' => $seq, 'USE_YN' => 'Y'])->first();
    }


}


